pragma solidity ^0.4.19;

import "./Interfaces/ITrustAnchor.sol";
import "./Interfaces/ITrustAnchorStorage.sol";

// a connector to the Decentralized IDentity standard [DID] https://w3c-ccg.github.io/did-spec
// There is a Shyft contract mediating interfaces between the native attestation system of Shyft, and the
// decentralized identities system.

// The data store is mediated by external contracts, and this function acts as a custom Trust Anchor
// with no data retrieval asset pipelines.

// The primary difficulty in constructing asset custody chains with external references is the source
// of truth of the origin of the attestations. Having an external mediating entity (oracle) does no good
// when the transfer needs to occur in an atomic fashion.

// Due to this process, the Trust Channel this Trust Anchor corresponds to may need to have asset transmission
// limitations or enhanced biometric requirements.

// Similarly, attestations produced by this Trust Anchor could act as a fundamental interface layer which
// the data retrieval contracts could use in an asynchronous fashion. Other Trust Anchors may want to
// subscribe to this Trust Anchor's Trust Channel to allow their users to maintain a probablistic
// Source of Funds [SOF] when transacting with other users within the extended Trust Channel.

// The Trust Channel this Trust Anchor creates is within the extended field [2048+] which is an additional
// lookup series which creates an additional transaction cost by the additional complexity. It will thusly
// still be in the user's best interest to associate with a Trust Anchor and hence Trust Channels of a
// smaller order.

// The creation and application of a DID on the Shyft Extended Trust Anchor system is a multi-stage process.
//
// (1) The first is the creation of the DID itself, where the data storage pointer and owner are set, and
// a contract storage fee is paid which effectively stakes the DID itself on the Shyft network.
//
// (2) The second step is an attestation application function, specifying the address to perform the
// attestation upon. This stage requires enough Shyft fuel to properly "bake" the attestation into the user's
// connectivity graph.
//
// (3) The third stage is that the user would trigger a consent message on their own attestation.
//
// (4) The fourth stage is that (a) party may bake that attestation into the user's connectivity graph. This
// creates a consent-layer connectivity to the user's trust channel graph, enabling enhanced functionality.

// ######## GDPR/PII info #######
//
// The record being removed zeros out the balance of the did's presence/stake, and
// zeros out the dataAddress (hence making it a data piece that pruning node instances
// can have the option of never storing). This is a financial transaction which is
// required to remain known for the public ledger system to function.

contract DIDTrustAnchor is ITrustAnchor {

    struct didStructure {
        uint16 version;

        address owner;

        //@note: this links to an external smart contract which can load data.
        address dataAddress;
        uint256 contractStore;
    }

    mapping(bytes32 => didStructure) didRegistry;
    uint256 totalStore;

    uint256 minimumRequiredStake = 2 ** 18;

    address trustAnchorStorageAddress = address(0);

    address owner = address(0);

    //@note:@todo:@next:@audit: should this contract have "Administrable" style multisig involved for the setting
    // of the contract relationships?

    function isOwner() internal view returns (bool result) {
        if (msg.sender == owner) {
            //is owner
            return true;
        } else {
            //not owner
            return false;
        }
    }

    //returns:
    // 0 = not owner
    // 1 = set trustAnchorStorage

    function setTrustAnchorStorageAddress(address _trustAnchorStorageAddress) public returns (uint8 result) {
        if (isOwner()) {
            require(_trustAnchorStorageAddress != address(0));

            //@note:@todo:@next:@audit: what happens to the existing attestations when we change these relationships?
            // example: 1) should they all be revoked?
            //  or 2) should all of their consent be revoked?
            //  etc.
            trustAnchorStorageAddress = _trustAnchorStorageAddress;

            //set trustAnchorStorageAddress
            return 1;
        } else {
            //not owner
            return 0;
        }
    }

    constructor(uint256 _minimumRequiredStake) {
        owner = msg.sender;

        extendedModeJurisdiction = true;
        minimumRequiredStake = _minimumRequiredStake;
    }

    //@note: This function creates a DID record within Shyft.

    //returns:
    // 1 = successfully created DID record

    //@note:@here: didKeccak is an externally generated key that hashes the data inside of the did record.

    function createDID(bytes32 _didKeccak, address _owner, address _dataAddress) payable returns(uint8 result) {
        // make sure that the value being staked for this DID is above the minimum requirement.
        if (msg.value < minimumRequiredStake) {
            revert();
        }

        if  (didRegistry[_didKeccak].version == 0) {
            didStructure storage didStruct = didRegistry[_didKeccak];
            didStruct.version = 1;
            didStruct.owner = _owner;
            didStruct.dataAddress = _dataAddress;
            didStruct.contractStore = msg.value;
            totalStore += msg.value;

            // successfully created DID record
            return 1;
        } else {
            //revert because of the financial transaction.
            revert();
        }
    }

    //@note: removes the DID record from the platform. the funds used to stake to this DID are returned to
    // the owner, or another counterparty the owner proscribes to.

    //returns:
    // 0 = not owner
    // 1 = successfully removed DID record

    function removeDID(bytes32 _didKeccak, address _contractStoreDestination) public returns (uint16 result) {
        didStructure storage didStruct = didRegistry[_didKeccak];
        if (msg.sender == didStruct.owner) {
            didStruct.version = uint16(2 ** 16 - 1);

            //@note:@todo:@next:@critical:@safemath
            uint256 valueStored = didStruct.contractStore;

//            totaLStore -= valueStored;
            didStruct.contractStore = 0;
            didStruct.dataAddress = 0;

            _contractStoreDestination.transfer(valueStored);

            //successfully removed DID record
            return 1;
        } else {
            //not the owner
            return 0;
        }
    }

    function setAttestation(address _identifiedAddress,
        uint16 _jurisdiction,
        uint64 _effectiveTime,
        uint64 _expiryTime,
        bytes _publicData,
        bytes _documentsMatrixEncrypted,
        bytes32 _availabilityAddressEncrypted) public returns (uint8 result);

    //@note:@here: This function prebakes (sets data, sets all the consent etc.) for a specific did.
    // This includes setting the attestation within the Trust Anchor Storage function.

    //returns:
    //0 = extended jurisdiction overflow present
    // 1 = message sender is not did owner
    // 2 = attestation did not complete

    // @note: the following two return values actually revert this whole transaction as data was set up within
    // the Trust Anchor Storage.

    // 3 = trust anchor signature not correct
    // 4 = user signature not correct
    // 5 = attestation set correctly, not yet baked

    function prebakeDID(bytes32 _didKeccak,
                     address _identifiedAddress,
                     uint16 _jurisdiction,
                     uint64 _effectiveTime,
                     uint64 _expiryTime,
                     bytes _publicData,
                     bytes _documentsMatrixEncrypted,
                     uint8 _attestationValidityTrustAnchorSignatureV,
                     bytes32[2] _attestationValidityTrustAnchorSignatureRS,
                     uint8 _attestationValidityUserSignatureV,
                     bytes32[2] _attestationValidityUserSignatureRS,
                     bool _isManaged) returns (uint16 result) {

        // check whether the jurisdiction input plus the "extended jurisdiction" would cause
        // an overflow.
        if (uint32(_jurisdiction) + uint32(ITrustAnchor.extendedJurisdiction) < 2 ** 16) {
            didStructure storage didStruct = didRegistry[_didKeccak];

            if (didStruct.owner == msg.sender) {
                ITrustAnchorStorage trustAnchorStorage = ITrustAnchorStorage(trustAnchorStorageAddress);
                uint8 setResult;
                bytes32 attestationKeccak;

                (setResult, attestationKeccak) = trustAnchorStorage.setAttestation( _identifiedAddress,
                    ITrustAnchor.extendedJurisdiction + _jurisdiction,
                    _effectiveTime,
                    _expiryTime,
                    _publicData,
                    _documentsMatrixEncrypted,
                    bytes32(address(this)),
                    _isManaged);

                if (setResult == 3) {
                    uint8 signResult = trustAnchorStorage.signAttestationTrustAnchorSignature(attestationKeccak, _attestationValidityTrustAnchorSignatureV, _attestationValidityTrustAnchorSignatureRS);
                    if (signResult == 3) {
                        signResult = trustAnchorStorage.signAttestationUserSignature(attestationKeccak, _attestationValidityUserSignatureV, _attestationValidityUserSignatureRS);

                        if (signResult == 3) {
                            //@note:@here:@todo:@next: make this a required component?
                            //            trustAnchorStorage.compileAttestation()

                            //attestation set correctly, not yet baked
                            return 5;
                        } else {
                            //user signature not correct @note: reverts since an attestation was set.
                            revert();
//                            return 4;
                        }
                    } else {
                        //trust anchor signature not correct. @note: reverts since an attestation was set.
                        revert();
//                        return 3;
                    }
                } else {
                    //attestation did not complete
                    return 2;
                }
            } else {
                //message sender is not did owner
                return 1;
            }
        } else {
            //extended jurisdiction overflow present
            return 0;
        }
    }

    //returns:
    // address = address of linked data structure.
    function getDataAddress(bytes32 didKeccak) returns (address dataAddress) {
        didStructure storage didStruct = didRegistry[didKeccak];

        return didStruct.dataAddress;
    }


}
